import React from 'react';
import '../App/App.css';
import Banner from '../Banner/Banner';

const homeInfo = {
    title: 'Home',
    path: '/',
    cName: 'nav-text',
    imageSrc: '../images/profile.png',
    name: 'home'
}

class Home extends React.Component {

    render(){
        return (
            <div className='home'>
                
                <Banner 
                imageSrc = {homeInfo.imageSrc}/>
            </div>
        )
    }
}

export default Home;
